import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
        <Row className="top align-items-center">
          <Container>
            <Col>
              <p className="label">Top Nav.</p>
            </Col>
          </Container>
        </Row>
        <Row className="bottom align-items-center">
          <Container>
            <Col>
            <p className="label">Top Nav.</p>
            </Col>
          </Container>
        </Row>
      </nav>
    );
  }
}

export default Nav;
